dict.string:
readonly file="${alfred_workflow_data}/vaults.json"

if [[ -f "${file}" ]]; then
  cat "${file}"
  exit 0
fi

echo '{
  "rerun": 0.1,
  "items": [{
    "title": "Sign in and update items",
    "arg": "update_items"
  }]
}'

function run() {
  const itemID = $.NSProcessInfo.processInfo.environment.objectForKey("itemID").js
  const query = itemID + "=" + itemID

  const url = $.NSProcessInfo.processInfo.environment.objectForKey("url").js
  const urlObject = $.NSURL.URLWithString(url)

  if (urlObject.query.js === undefined) return url + "?" + query
  return url + "&" + query
}

readonly action="${1}"

case "${action}" in
  'Open and Fill') echo -n 'openandfill';;
  'View in 1Password') echo -n 'view';;
  'Copy Username') ./1password.js 'copy_by_label' 'username' "${itemID}";;
  'Copy Password') ./1password.js 'copy_by_label' 'password' "${itemID}";;
  'Copy OTP') ./1password.js 'copy_otp' "${itemID}";;
  *) echo "Invalid action: ${action}" >&2; exit 1
esac
